('4592efea-5925-42ca-a568-8b4f2c960c36', 'Prefeitos lindeiros alinham ações conjuntas em prol do desenvolvimento regional', 'prefeitos_lindeiros_alinham_açoes_conjuntas_em_prol_do_desenvolvimento_regional', '2022-08-28 23:59:11', 'Os prefeitos lindeiros, alguns representantes de administrações municipais, e membros da diretoria do Conselho de Desenvolvimento dos Municípios Lindeiros ao Lago de Itaipu se reuniram nesta terça-feira (09), para alinhar algumas ações da entidade. A definição da próxima assembleia e o andamento do Programa de Governança, Inovação e Inteligência para Desenvolvimento dos Arranjos Produtivos nos Municípios Lindeiros ao Lago de Itaipu (PGR), estiveram em pauta.\n\nO objetivo foi compartilhar e discutir ações e iniciativas inerentes à entidade e a região lindeira. Conforme o presidente, prefeito de Guaíra, Heraldo Trento, o que se busca é apresentar aos prefeitos diversas iniciativas conjuntas e que estão relacionadas aos municípios membros do Conselho dos Lindeiros, e ouvir sugestões.\n\nOs prefeitos voltaram a falar sobre a Usina de Projetos, contribuições dos municípios, e interação em busca do desenvolvimento.\n\nOs participantes da reunião definiram a próxima Assembleia Geral Ordinária, para dia 01 de setembro às 8h e 30min, no Centro Cultural de Pato Bragado\n\nA reunião foi pautada pelo planejamento e alinhamento no intuito de promover a transformação do território, de forma a contemplar estruturas, ações e projetos regionais, o que integra a base de atuação do Programa de Governança Regional.', '5e424218-f9a8-4ce8-8947-38178776c2b9', '8eaa3453-1588-4fc3-a0ae-67e4ecd7d520'),
('87bfca5e-333c-4bff-a77f-26c78c4f4649', 'Conselho dos Lindeiros solidifica parcerias para projetos estruturantes na região', 'conselho_dos_lindeiros_solidifica_parcerias_para_projetos_estruturantes_na_regiao', '2022-08-28 23:29:08', 'O Conselho de Desenvolvimento dos Municípios Lindeiros ao Lago de Itaipu reuniu, nesta quinta-feira (20), prefeitos, vereadores, presidentes de associações comerciais e outras lideranças regionais e estaduais para Assembleia Geral Ordinária (AGO). O evento ocorreu em Guaíra e antecedeu o lançamento do Prodesg (Programa de Desenvolvimento do Município de Guaíra).\n\nNa pauta de discussões esteve o Programa de Governança, Inovação e Inteligência para Desenvolvimento dos Arranjos Produtivos nos Municípios Lindeiros ao Lago de Itaipu com relatório de 2021 e ações para 2022; O andamento e funcionamento do convênio TST asfaltamentos; Apresentação dos programas e ferramentas do Invest Paraná; Apresentação de dispositivo de telemedicina – Invest Paraná; Assinatura de termos de cooperação técnica entre o Conselho dos Lindeiros e entidades, compostas por universidades e órgãos do Estado do Paraná; Prestação de contas do ano de 2021 pelo conselho fiscal e assuntos gerais\n\nO presidente citou a assinatura de dois termos de cooperação, um com a Universidade Tecnológica Federal do Paraná (UTFPR) e outro com a Universidade Estadual de Mato Grosso do Sul (UEMS). “Já temos esta parceria com a Unioeste (Universidade Estadual do Oeste do Paraná) para cuidar da implantação de uma usina de projetos, que tramita junto à Itaipu Binacional e teremos condições para criar um fundo para projetos estruturantes na região”, ressaltou Trento.\n\nTermos de cooperação\nO major Washington Vasconcelos Santana, que representou a Itaipu Binacional no evento, ressaltou que é uma satisfação verificar o trabalho que o Conselho dos Lindeiros faz na região. “Ficamos muito felizes com o que foi apresentado na Assembleia Ordinária. A região toda terá um ganho fundamental, não só na parte infraestrutura como também na inovação, tecnologia, saúde, turismo e meio ambiente”, ressalta. “Quero parabenizar o Lindeiros pelo brilhante projeto que está sendo desenvolvido o que fortalece a parceria com Itaipu”, enfatiza.\n\nParceria fortalecida\nO major Washington Vasconcelos Santana, que representou a Itaipu Binacional no evento, ressaltou que é uma satisfação verificar o trabalho que o Conselho dos Lindeiros faz na região. “Ficamos muito felizes com o que foi apresentado na Assembleia Ordinária. A região toda terá um ganho fundamental, não só na parte infraestrutura como também na inovação, tecnologia, saúde, turismo e meio ambiente”, ressalta. “Quero parabenizar o Lindeiros pelo brilhante projeto que está sendo desenvolvido o que fortalece a parceria com Itaipu”, enfatiza.', '5e424218-f9a8-4ce8-8947-38178776c2b9', '8eaa3453-1588-4fc3-a0ae-67e4ecd7d520'),
